import React from 'react';

const Header = () => {
  return (
    <div className="pt-10 px-6 sm:px-24 flex justify-between">
      <div className="flex items-center text-white font-bold">
        <img src="/pulse-logo.png" alt="Pulse Logo" className="h-12" />
      </div>
      <div className="w-[441px] h-[39px] p-2.5 justify-center items-center gap-10 inline-flex">
        <div>
          <a href="mailto:pulsefitnessapp@gmail.com" className="text-zinc-800 text-base font-bold font-['HK Grotesk'] capitalize">Features</a>
          <div className="w-[70px] h-[1.80px] bg-black"></div>
        </div>
        <a href="mailto:pulsefitnessapp@gmail.com" className="text-gray-700 text-base font-medium font-['HK Grotesk'] capitalize">Creators</a>
        <a href="mailto:pulsefitnessapp@gmail.com" className="text-gray-700 text-base font-medium font-['HK Grotesk'] capitalize">Pricing</a>
        <a href="mailto:pulsefitnessapp@gmail.com" className="text-gray-700 text-base font-medium font-['HK Grotesk'] capitalize">Support</a>
        <a href="mailto:pulsefitnessapp@gmail.com" className="text-gray-700 text-base font-medium font-['HK Grotesk'] capitalize">Contact Us</a>
      </div>
    </div>
  );
};

export default Header;
